INSERT INTO `article` VALUES ('20', 'shell基础编程', '\n### shell基础编程\n#### 1编写shell程序判断字符串是否为数字字符串\n\n```\n#! /bin/bash\nexpr $1 \"+\" 10 &> /dev/null\nif [ $? -eq 0 ];then\n  echo \"$1 is number\"\nelse\n  echo \"$1 not number\"\nfi\n\n```\n#### 2编写shell程序比较2个数的大小\n\n```\n#! /bin/bash\nmax=0\nif [ \"$1\" -ge \"$2\" ]\nthen\nmax=\"$1\"\nelse\nmax=\"$2\"\nfi\necho \"max的值为：\"\necho $max\n```\n\n\n#### 3编写shell程序判断输入的信息是否为0·9数字，如果是则输出对应的数字，否则输出“输入不正确提示”\n\n```\n#! /bin/bash\nread -p \"Please input an integer: \" num\ncase \"$num\" in\n*[!0-9]*)\necho \"输入不正确\";;\n*       )\necho $num;;\nesac\n\n```\n#### 4编写shell程序计算1·100的和\n\n```\n#!/bin/bash\n\nsum=0\nfor i in `seq 1 100`\ndo\n    sum=$[$i+$sum]\ndone\necho $sum\n~          \n```\n\n\n#### 5 编写shell程序每个2秒输出一次“系统挂载”\n\n```\n#! /bin/bash\nwhile true\n\n        do\n\n        echo \"系统挂载\"\n\n        sleep 1\n\n        done\n```\n\n#### 6 编写shell程序批量创建10个账号并创建密码\n\n创建用户\n```\n#! /bin/bash\nsource /etc/profile\n\n\nfor num in `seq  -f \'%02g\' 1 10`\n\ndo\n        useradd yuki${num} -M\n        definePasswd=`echo $RANDOM |md5sum|cut -c 1-8`\n        echo ${definePasswd} | passwd --stdin yuki${num}\n        echo  yuki${num}  definePasswd is ${definePasswd} >> /home/savePasswd.log\n\ndone\n\n```\n\n删除用户\n```\n\n#! /bin/bash\nsource /etc/profile\n\nfor num in `seq -f \'%02g\' 1 10`\ndo\n        userdel -r yuki${num}\ndone\n\n```\n\n#### 7 编写shell程序：手机充值10元，每发一条信息花费1角5分。当余额低于1角5分时，不能再发短信，并提示“余额不足，请充值”。充值后可以继续发短信。\n\n```\n#! /bin/bash\nTOTAL=1000\nCONSUME=200\n\nfunction isnum(){\nexpr $1 + 1 &>/dev/null\nif [ $? -ne 0 -a \"$1\" != \"-1\" ];then\nreturn 1\nfi\nreturn 0\n}\n\nfunction consume(){\nread -p \"please input your message:\" content\nread -p \"Are you sure send?{y|Y|n|N}:\" option\ncase $option in\ny|Y)\necho \"send $content successfully!!!\"\n((TOTAL=TOTAL-CONSUME))\necho \"you money haved $TOTAL availed\"\n;;\nn|N)\necho \"canceled\"\n;;\n*)\necho \"invalid input\"\n;;\nesac\n}\n\nfunction recharge(){\nif [ $TOTAL -le $CONSUME ];then\necho \"you money haved $TOTAL availed,it is not enough!!!\"\nread -p \"you want to recharge money?{y|Y|n|N}:\" option2\ncase $option2 in\n\n```\n', '4', '何袁辉', '2020-05-22 14:51:46', '0', '2', '0', 'shell', '1', '1', '1', 'http://localhost:8081/images/veer-1246760981571116763731.jpg', '1', '1', 'Linux', '学习linux不可避免的要学习shell编程，shell编程和其他的编程语言一样有他自己的语法规范，可能和其他的编程语言的语法差异比较大，在习惯了其他编程语言的情况下，想要入手shell确实不是一件容易的事情。');
INSERT INTO `article` VALUES ('21', 'mysql事务', '\n\n## Mysql事务：\n### 事务的概念：\n对于用户而言，事务是具有完整逻辑意义的数据库操作序列的集合。对于数据库管理系统而言，事务是一个读写操作序列。这些操作是一个不可分割的逻辑工作单元，要么都做，要么都不做。\n\n### 事务结束语句： \n\n**1 事务提交（commit）**：将成功完成事务的执行结果（即更新）永久化，并释放事务占有的全部资源\n                      \n **2 事务回滚(rollback)  :**  终止当前事务，撤销其对数据库做的更新，并释放事务占有的全部资源。\n\n### 事务的特性：\n**原子性**：事务的所有操作要么全部被执行，要么都不被执行\n\n**一致性**：一个单独执行的事务应保证其执行的结果的一致性，即总是将数据库从一个一致性状态转化到另一个一致性状态。事务的一致性包括显式一致性和隐式一致性。显式一致性是显式定义的完整性约束，，如主码，外码，自定义约束等。隐式一致性是业务规则隐含的完整性要求。如机票售出后，一航班已售出票数和剩余票数之和应该等于该航班的全部座位数；转账完成后A和B账户的存款余额总和不变。\n                       \n**持久性**：一个事务提交成功后，他对数据库的改变必须是永久的，即使随后系统出现故障也不会受到影响\n\n**隔离性**：多个事务并发执行时，一个事务的执行不i能影响另一个事务，即并发执行的各个事务之间不能相互干扰\n### 事务的并发执行可能导致的问题：\n\n\n**1 脏读**：如果T2读取到了T1修改但未提交的数据后，T1由于某种原因中止而撤销，这时T2就读到了不一致的数据\n\n**2 不可重复读：**\n\n（1）   事务Ti 2次从数据库读取到的结果不同。Ti读取一数据后，Tj对该数据进行了修改，当Ti再次读取该数据时，则会读到与前一次不同的值。 \n\n（2）（幻读）Ti按照某条件读取数据库中的某些记录后，Tj删除/插入了一些记录，当Ti再次读取时，发现记录数改变了。\n      \n**3 丢失更新（虚读）**：2个或多个事务都读取了同一个数据并修改，最后提交的事务的执行结果覆盖了前面的事务提交的执行结果，而导致前面事务的更新被丢失。\n\n\n### mysql数据库提供的4种隔离级别：\n**1.Read uncommitted（读未提交）**：最低级别，任何情况都无法保证\n\n**2.Read committed（读已提交**） ：可以避免脏读\n\n**3.Repeatable read （可重复度）**：避免脏读，不可重复度   （mysql默认）\n\n**4.Serializable（串行化）**  ：避免脏读。不可重复度，丢失更新\n', '8', '何袁辉', '2019-12-31 13:21:59', '1', '4', '0', 'mysq:事务', '1', '1', '1', 'http://localhost:8081/images/veer-3023644431571116763768.jpg', '1', '1', 'MySQL', '对于用户而言，事务是具有完整逻辑意义的数据库操作序列的集合。对于数据库管理系统而言，事务是一个读写操作序列。这些操作是一个不可分割的逻辑工作单元，要么都做，要么都不做');
INSERT INTO `article` VALUES ('22', '布隆过滤', '### 布隆过滤\n基本原理：当一个元素被加入集合时，通过k个散列函数将这个元素映射到一个位数组中的k个点，把他们置为1。检索时，我们只需要看这些点是不是都是1，就（大约）直到集合中有没有他了：如果这些点中有任何一个点为0，则被检索元素一定不存在；如果都是1，则该元素很可能存在。\n\n#### 原理图：\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20191104221721619.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80MjE0Njk5Ng==,size_16,color_FFFFFF,t_70)\n\n#### 分析：\n不用保存原始数据，只需要保存原始数据的位图，位图占据的空间很小。只需要经过k次hash进行比对即，效率高。但是会不准确，造成一定的误差\n\n**模拟代码如下**：\n\n```package dataStructure.hash;/**\n\n\nimport java.math.BigInteger;\nimport java.security.MessageDigest;\nimport java.security.NoSuchAlgorithmException;\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.logging.Level;\nimport java.util.logging.Logger;\n\npublic class BoolmFilter {\n	public static final int  NUM_SLOTS=1024*1024*8;   //位图的长度\n	public static final int NUM_HASH=8;        //hash函数的个数  每一个hash函数结果用于标记一个位\n	private BigInteger bitMap=new BigInteger(\"0\");	   //位图\n\n\n	public static void main(String[] args) {\n		BoolmFilter bf=new BoolmFilter();\n		List<String> list=new ArrayList<String>();\n		list.add(\"eyufgvdvc\");\n		list.add(\"eyufgvdvc1\");\n		list.add(\"eyufgvdvc2\");\n		list.add(\"eyufgvdvc3\");\n		list.add(\"eyufgvdvc4\");\n		list.add(\"eyufgvdvc5\");\n		for (int i = 0; i <list.size() ; i++) {\n			bf.addElement(list.get(i));\n		}\n		System.out.println(bf.checkElement(\"eyufgvdvc\"));\n		System.out.println(bf.checkElement(\"eyufgvdvc1\"));\n		System.out.println(bf.checkElement(\"eyufgvdvc2\"));\n		System.out.println(bf.checkElement(\"eyufgvdv\"));\n		System.out.println(bf.checkElement(\"eyufgvd\"));\n		System.out.println(bf.checkElement(\"eyufgvdvcc\"));\n	}\n\n\n	//模拟的hash算法\n	public int hash(String message,int n){\n		message=message+String.valueOf(n);\n		try {\n			MessageDigest md5=MessageDigest.getInstance(\"md5\"); //MD5是将任意输入映射成128位整数的hash函数\n			byte[] bytes=message.getBytes();       //字符串转化成字节数组\n			md5.update(bytes);\n			byte[] digest = md5.digest();           //128位  16个字节的数组\n			BigInteger bigInteger=new BigInteger(digest);        //至此  获取到了message的128位整数\n			return  Math.abs(bigInteger.intValue())%NUM_SLOTS;     //128位整数可能超出位图的大小    所以进行了取余操作\n		} catch (NoSuchAlgorithmException e) {\n			e.printStackTrace();\n			Logger.getLogger(BoolmFilter.class.getName()).log(Level.SEVERE,null,e);\n		}\n\n		return -1;\n	}\n\n\n	//处理原始数据：每hash(message)一次---->就标注一个位；操作k次\n	//hash的值域位：0~NUM_SLOTS-1\n	public void addElement(String meaasge){\n		for (int i = 0; i <NUM_HASH ; i++) {\n			int hashCode=hash(meaasge,i);      //进行k次hash操作     根据参数的不同   此处模拟了8个不同的hash函数\n			if(!bitMap.testBit(hashCode)){          //如果该位置还不为1\n				bitMap=bitMap.or(new BigInteger(\"1\").shiftLeft(hashCode));  //用于标注位图的该位值为： 1\n			}\n		}\n	}\n\n\n//判断某一个元素是否存在\n	public boolean checkElement(String message){\n		for (int i = 0; i <NUM_HASH ; i++) {\n			int hashCode=hash(message,i);    //hashCode代表一个位置\n			if(!bitMap.testBit(hashCode)){         //如果在位图的该位置为0\n				return  false;\n			}\n		}\n		return  true;     //不精确，有可能误判\n	}\n}\n\n```\n', '32', '何袁辉', '2019-12-31 13:21:56', '0', '36', '0', '布隆过滤', '1', '1', '1', 'http://localhost:8081/images/veer-3008380361571116763755.jpg', '1', '1', '数据结构', '当一个元素被加入集合时，通过k个散列函数将这个元素映射到一个位数组中的k个点，把他们置为1。检索时，我们只需要看这些点是不是都是1，就（大约）直到集合中有没有他了：如果这些点中有任何一个点为0，则被检索元素一定不存在；如果都是1，则该元素很可能存在。');
INSERT INTO `article` VALUES ('23', '海量数据分析', '### 最多出现次数\n题目描述：有一个包含20个亿全是32位整数（4byte）的大文件，在其中找到出现次数最多的数。\n\n\n#### 分析：\n使用hashmap，每一个元素维护一个出现次数：比如(\"1\",1)，(\"2\",2),(\"3\",1),key:表示某个元素，value:表示某个元素出现的次数，对文件的每一个元素进行扫描，使用map.contains(\"key\")判断是否存在，如果存在就map.get(\"key\"),然后value的值加1，再map.put(key,value),如果不存在直接map.put(key,value);\n上述方法看似可行，但是特备耗内存，假设元素key占4个字节，value占4个字节，那么就是一共就是160亿个字节，也就是16G，一共需要消耗16个G的内存，这是肯定不合适的。一次可以采用hash的方法将文件拆分成16个文件，每个文件大约就是一个G，然后对每一个文件进行hashMap操作，大约需要消耗2个G，看起来是可行的。在每一个文件求出Top1，一共就有16个Top1，然后在16个Top1中求出最后的那个Top1\n#### 原理图：\n![海量数据1.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9pLmxvbGkubmV0LzIwMTkvMTEvMDQvd0FwbldlQ3VMVm8za0taLnBuZw?x-oss-process=image/format,png)\n\n### 未出现过的数\n题目描述：32位无符号整数的范围是：0~4294967295(42亿)，现在正好有一个40亿个无符号数整数的文件，所以在整个范围中必然有没有出现过的数。最多可以使用1G的内存，怎么找到所有没有出现过的数。\n#### 分析：\n开辟一个位图空间，长度为2的32次方减1，每一个位置上的值为0或1，代表该对应位置的值是否出现过，最后只需要遍历这个位图空间，值为0的即是没有出现过的数据，该空间的大小为：2的32次方bit，大约500M。\n#### 原理图：![海量数据2.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9pLmxvbGkubmV0LzIwMTkvMTEvMDQvZ2xpazNtNVZSTGNEYkVzLnBuZw?x-oss-process=image/format,png)\n\n### TopK\n题目描述：找到100亿个URL中重复的URL，以及搜索词汇的Topk问题。\n#### 分析\n假设每一个Url占64个字节，那么大约就是64G的内存，可以根据hash分成64个小文件，每一个文件中统计词频，维护大小为100 的小顶堆，最后生成的n个小顶堆，然后再外部使用排序获取TopK\n\n#### 原理图：同第一题', '32', '何袁辉', '2019-12-03 09:56:55', '5', '12', '0', '海量数据', '1', '1', '1', 'http://localhost:8081/images/veer-3033125411571116763788.jpg', '1', '1', '数据结构', '随着互联网的发展，海量数据在今天越来越普遍了，互联网企业对于海量数据的处理更是尤为重要。对于大数据量的问题有很多，topk，海量数据找重复的等等。一般这种问题都涉及到处理大数据量的算法，其中个hash算法尤为重要。');
INSERT INTO `article` VALUES ('25', '链表的基本操作', '# 单链表的基本操作\n\n### 单链表图示\n\n#### 单链表的删除节点操作\n![单链表1.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9pLmxvbGkubmV0LzIwMTkvMTAvMjkvb1l5cHZuVlphZUNFU0tXLnBuZw?x-oss-process=image/format,png)\n\n#### 单链表的添加节点操作（将节点添加到末尾）\n![单链表2.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9pLmxvbGkubmV0LzIwMTkvMTAvMjkvSzhacU01SlNhQkg3dE5HLnBuZw?x-oss-process=image/format,png)\n\n#### 单链表的添加节点操作（将节点添加到中间）\n![单链表3.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9pLmxvbGkubmV0LzIwMTkvMTAvMjkvd2xHSVJTeUs3cTU2aXpWLnBuZw?x-oss-process=image/format,png)\n### 定义单链表类\n\n```\n\npublic class NodeList {\n    Object object;\n	NodeList next;\n	public NodeList(Object object) {\n		this.object = object;\n	}\n}\n```\n\n### 定义操作接口\n\n```\npublic interface MyList {\n	void delete(int index);\n	void delete(Object element);\n	void add(Object element);\n	void update(int index,Object newElement);\n	boolean contains(Object target);\n	Object at(int index);\n	int indexOf(Object element);\n\n}\n\n```\n\n\n\n### 定义操作实现类\n\n```\n\npublic class SingleLinkList implements MyList{\n	private NodeList head; //头节点\n	private NodeList last;\n	int size;\n\n	public void delete(int index) {\n		if(index<0||index>=size) return;   //处理边界\n		int i=0;         //节点的索引\n		NodeList p=head;\n		NodeList pre=null;\n		while(p!=null){\n			if(i==index){\n				if(p==head){      //如果删除的是头节点\n					head=head.next;   //头节点后移\n				}else {\n					pre.next=p.next;\n				}\n				size--;\n				break;\n			}\n			pre=p;         //前驱指针后移\n			p=p.next;     //p指针后移\n			i++;\n		}\n\n	}\n\n	public void delete(Object element) {\n		NodeList p=head;    //头本身不能动\n		NodeList pre=null;  //p节点的前一个节点    相当于p的前驱   因为是单链表   要实现删除的话   必须要2个指针挨着移动才可以\n		while(p!=null){\n			if(p.object.equals(element)){\n				if(p==head){     //如果删除的是头部节点\n					head=head.next;       //将头部节点后移\n				}else {\n					pre.next=p.next;\n				}\n				size--;\n				break;    //删除元素后  没必要再继续移动了\n			}\n			pre=p;        //前驱指针后移\n			p=p.next;     //p指针后移\n		}\n\n	}\n\n	public void add(Object element) {\n		if(head==null){                   //链表为空\n			head=new NodeList(element);\n			last=head;          //头节点   尾节点都是这个节点\n		}else {\n			last.next=new NodeList(element);\n			last=last.next;   //尾指针后移\n		}\n		size++;          //链表的大小+1\n\n	}\n\n	public void update(int index, Object newElement) {\n		if(index<0||index>=size) return; //处理边界\n		int i=0;         //节点的索引\n		NodeList p=head;\n		while(p!=null){\n			if(i==index){\n				p.object=newElement;\n				break;\n			}\n			p=p.next;     //p指针后移\n			i++;\n		}\n	}\n\n	public boolean contains(Object target) {\n		NodeList p=head;\n		while(p!=null){\n			if(p.object.equals(target)){\n				return true;\n			}\n			p=p.next;     //p指针后移\n		}\n		return false;\n	}\n\n	public Object at(int index) {\n	if(index<0||index>=size) return null; //处理边界\n		int i=0;         //节点的索引\n		NodeList p=head;\n		while(p!=null){\n			if(i==index){\n				return p.object;\n			}\n			p=p.next;     //p指针后移\n			i++;\n		}\n		return null;\n	}\n\n	public int indexOf(Object element) {\n		int i=0;         //节点的索引\n		NodeList p=head;\n		while(p!=null){\n			if(p.object.equals(element)){\n				return i;\n			}\n			p=p.next;     //p指针后移\n			i++;\n		}\n		return -1;\n	}\n\n\n\n\n\n	@Override\n	public String toString() {\n	NodeList p=head;    //不要随便去动原来的饿头节点  因此复制一份\n		StringBuilder sb=new StringBuilder(\"[\");\n		while(p!=null){\n			sb.append(p.object);\n			p=p.next;\n			if(p!=null){\n				sb.append(\",\");\n			}\n		}\n		sb.append(\"]\");\n		return sb.toString();\n	}\n}\n```\n\n\n# 双链表的基本操作\n\n### 双链表图示\n\n#### 双链表删除节点\n![双链表1.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9pLmxvbGkubmV0LzIwMTkvMTAvMjkvak5pdlpNbzZKU1hZcmhjLnBuZw?x-oss-process=image/format,png)\n\n\n#### 双链表添加节点\n![双链表2.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9pLmxvbGkubmV0LzIwMTkvMTAvMjkvbjRmM3VVdlhnd29ZaHBXLnBuZw?x-oss-process=image/format,png)\n\n\n\n### 双链表定义类\n\n```\n\npublic class DoubleListNode {\n	 DoubleListNode next;     //前驱\n	 DoubleListNode pre;      //后继\n	 Object data;\n\n\n	public DoubleListNode(Object data) {\n		this.data = data;\n	}\n}\n```\n### 定义接口操作\n\n\n\n```\npublic interface MyList {\n	void delete(int index);\n	void delete(Object element);\n	void add(Object element);\n	void update(int index,Object newElement);\n	boolean contains(Object target);\n	Object at(int index);\n	int indexOf(Object element);\n\n}\n\n```\n\n### 双链表操作实现类\n\n\n```\n\npublic class DoubleNode implements MyList {\n	//将头节点和最后一个节点赋空     实际的第一个元素是head.next\n	private DoubleListNode head=new DoubleListNode(null);\n	private DoubleListNode last=new DoubleListNode(null);\n	private int size;\n\n	public DoubleNode() {      //初始化空的双链表\n		head.next=last;\n		last.pre=head;\n	}\n\n	public void delete(int index) {\n		if(index<0||index>=size) return;\n		int i=0;\n		DoubleListNode p=head.next;\n		while(p!=last){\n			if(i==index){\n				p.pre.next=p.next;\n				p.next.pre=p.pre;\n				//更快的被垃圾回收\n				p.next=null;\n				p.pre=null;\n				size--;\n				break;\n			}\n			p=p.next;\n			i++;\n		}\n	}\n\n	public void delete(Object element) {\n		DoubleListNode p=head.next;\n		while(p!=last){\n			if(p.data.equals(element)){\n					//只需要维护2条指针即可\n					p.pre.next=p.next;\n					p.next.pre=p.pre;\n					//为什么要加这2条语句   为了更快的成为垃圾回收对象\n					p.pre=null;\n					p.next=null;\n					size--;\n					break;\n				}\n			p=p.next;\n		}\n	}\n\n	public void add(Object element) {\n		DoubleListNode newNode=new DoubleListNode(element);\n		//维护了四条指针   如果不明白可以看图帮助\n		last.pre.next=newNode;\n		newNode.next=last;\n		newNode.pre=last.pre;\n		last.pre=newNode;\n		size++;\n	}\n\n	public void update(int index, Object newElement) {\n		if(index<0||index>=size)return;\n		DoubleListNode p=head.next;\n		int i=0;\n		while (p != last) {\n			if(i==index){\n				p.data=newElement;\n				break;\n			}\n			i++;\n			p=p.next;\n		}\n	}\n\n	public boolean contains(Object target) {\n		DoubleListNode p=head.next;\n		while(p!=last){\n			if(p.data.equals(target)){\n				return true;\n			}\n			p=p.next;\n		}\n		return false;\n	}\n\n	public Object at(int index) {\n		DoubleListNode p=head.next;\n		int i=0;\n		while(p!=last){\n			if(i==index){\n				return p.data;\n			}\n			i++;\n			p=p.next;\n		}\n		return null;\n	}\n\n	public int indexOf(Object element) {\n		DoubleListNode p=head;\n		int i=0;\n		while(p!=last){\n			if(p.data.equals(element)){\n				return i;\n			}\n			i++;\n			p=p.next;\n		}\n		return -1;\n	}\n\n\n	@Override\n	public String toString() {\n		StringBuilder sb=new StringBuilder(\"[\");\n		DoubleListNode p=head.next;\n		while(p!=last){\n			sb.append(p.data);\n			if(p.next!=last) {\n				sb.append(\",\");\n			}\n			p=p.next;\n		}\n		return sb.toString();\n	}\n}\n\n```\n\n\n**注：上述图示是根据代码画出来的，不一定和教材上的相同，可能有所差异，请读者自行鉴别**\n', '32', '何袁辉', '2019-12-03 10:03:13', '0', '13', '0', '链表', '1', '1', '1', 'http://localhost:8081/images/veer-1080507621571114262184.jpg', '1', '1', '数据结构', '链表的操作是数据结构中的重要内容，对于一个好的编程人员来说，能够熟练的运用链表来解决问题，提高系统的效率。');
INSERT INTO `article` VALUES ('26', '虚拟机字节码执行引擎', '# 虚拟机字节码执行引擎\n\n### 概述\nJava虚拟机的执行引擎：输入的时字节码文件，处理过程是字节码解析的等效过程，输出的是执行结果。\n\n### 运行时栈帧结构\n一个线程中的方法调用链可能工会很长，很多方法都同时处于执行状态。对于执行引擎来说，在活动过程中，只有位于栈顶的栈帧才是有效的，称为当前栈帧，于这个栈帧相关联的方法称为当前方法。执行引擎运行的所有字节码指令都只针对当前栈帧进行操作。\n\n\n\n接下来详细的解释一下栈帧中的局部变量表，操作数栈，动态连接，方法返回地址等各个部分的作用和数据结构。\n\n\n![栈帧概念模型.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9pLmxvbGkubmV0LzIwMTkvMTAvMjgvTUFqSEI3UTR0SUxvYkVGLnBuZw?x-oss-process=image/format,png)\n\n\n### 1 局部变量表\n局部变量表是一组变量值储存空间，用于存放方法参数和方法内定义的局部变量，在java编译成Class文件时，就在方法的Code属性的max_locals数据项中确立了该方法所需要分配的局部变量表的最大容量。\n\n局部变量表的容量以变量褿（Slot）为最小单位，每一个Slot都应该能存放一个boolean，byte，char,short,int,float,reference或者returnAddress类型的数据。\n\n在方法执行时，虚拟机使用局部变量表完成参数值到参数变量列表的传递过程的。，如果执行的是实例方法（非static的），那局部变量表的第0位索引的Slot默认的是用于传递方法所属对象实例的引用，在方法中可以通过关键字this来访问到这个隐含的参数。\n\n\n### 2 操作数栈\n操作数栈是一个先进后出的栈，同局部变量表一样，操作数栈的最大深度也在编译的时候就写到Code属性的max_stacks数据项中。当一个方法刚刚开始执行的时候，这个方法的操作数栈是空的，在方法执行的过程中，会有各种字节码指令往操作数栈中写入和提取内容，也就是出栈和入栈操作。\n\n\n大多数虚拟机都会对局部变量表做一些优化处理，让下面栈帧的部分操作数栈与上面的栈帧的部分的局部变量表重叠在一起，这样就可共公用一部分数据。\n\n\n![栈帧数据共享.png](https://imgconvert.csdnimg.cn/aHR0cHM6Ly9pLmxvbGkubmV0LzIwMTkvMTAvMjgvUnJIa2pmMmh6c0ZYdmw4LnBuZw?x-oss-process=image/format,png)\n\n\n### 3 动态连接\n\n\n每一个栈帧都包含一个指向运行时常量池中该栈帧所属方法的引用，持有这个引用是为了支持在方法调用过程中的动态连接。（没有理解到）\n### 4 方法返回地址\n当方法开始执行后，只有2中方法可以退出这个方法。\n\n**1. 正常完成出口**：是执行引擎遇到任意一个方法返回的字节码指令，这时候可能会有返回值传递给上层的方法调用者（调用当前方法的方法称为调用者）。\n\n**2.异常完成出口：** 在方法执行过程中遇到了异常，并且这个异常没有在方法体内得到处理，无论是Java虚拟机内部产生的异常，还是使用athrow字节码指令产生的异常，只要在本方法的异常表中没有搜索到匹配的异常处理器，就会导致方法退出。\n\n\n\n无论采用哪种退出方式，在方法推出后，都需要返回方法被调用的位置，程序才能继续执行。一般来说方法正常退出时，调用者的PC计数器的值可以作为返回地址。方法异常退出时，返回地址时通过异常处理表来确定的。\n\n参考书籍：《深入理解java虚拟机》', '7', '何袁辉', '2019-12-03 10:04:31', '1', '120', '0', '虚拟机', '1', '1', '1', 'http://localhost:8081/images/75842f4d1e18d692a66c38eb172a40ab1575362156409.jpg', '1', '1', 'JVM', 'Java虚拟机的执行引擎：输入的时字节码文件，处理过程是字节码解析的等效过程，输出的是执行结果');
INSERT INTO `article` VALUES ('27', ' jvm内存模型', '### jvm内存模型\nJVM的内存模型很多人都看过，周志明老师的《深入理解Java虚拟机》已经解释的很清楚了。但是只限于概念性的知识，关于底层的原理并没有做深入的阐述，下面我们通过一个实例代码来分析JVM内存模型之间的联系与各模块之间的底层原理，底层比较复杂，可能篇幅有点长，请耐心阅读，一定给你讲透彻，阅读本文建议同《深入理解JVM》这本书一起参考。\n\n此处先上一段代码，以下通过代码逐步分析：\n\n```java\n\npublic class Math {\n	public int compute(){          //一个方法对应一块栈帧内存区域\n		int a=1;\n		int b=2;\n		int c=(a+b)*10;\n		return c;\n	}\n	public static void main(String[] args) {\n		Math math=new Math();\n		math.compute();\n	}\n}\n```\n\n这段代码生成的字节码文件如下：\n\n```java\n\nCompiled from \"Math.java\"\npublic class com.lucas.Demo1.Math {\n  public static final java.lang.Integer CONATANT;\n\n  public com.lucas.Demo1.Math();\n    Code:\n       0: aload_0\n       1: invokespecial #1                  // Method java/lang/Object.\"<init>\":()V\n       4: return\n\n  public int compute();\n    Code:\n       0: iconst_1\n       1: istore_1\n       2: iconst_2\n       3: istore_2\n       4: iload_1\n       5: iload_2\n       6: iadd\n       7: bipush        10\n       9: imul\n      10: istore_3\n      11: iload_3\n      12: ireturn\n\n  public static void main(java.lang.String[]);\n    Code:\n       0: new           #2                  // class com/lucas/Demo1/Math\n       3: dup\n       4: invokespecial #3                  // Method \"<init>\":()V\n       7: astore_1\n       8: aload_1\n       9: invokevirtual #4                  // Method compute:()I\n      12: pop\n      13: return\n\n  static {};\n    Code:\n       0: sipush        666\n       3: invokestatic  #5                  // Method java/lang/Integer.valueOf:(I)Ljava/lang/Integer;\n       6: putstatic     #6                  // Field CONATANT:Ljava/lang/Integer;\n       9: return\n}\n\n```\n\n\n\n\n还是先上最经典的那一幅JVM内存模型图：\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20191019151724253.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80MjE0Njk5Ng==,size_16,color_FFFFFF,t_70)\n\n我们先来分析虚拟机栈的内存结构（图中箭头可以不考虑，只是局部的图）：\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20191019154505572.png)\n\n以上图片的名词在此不做解释，默认读者已经知道，我们主要探究每一块区域的底层原理。\n\n以上java在执行时，线程main在虚拟机栈内存中开辟一块空间。每个方法按照顺序依次进栈，每一个方法在执行时开辟一个栈帧，栈帧中存储的信息见上图。下面依次解释每一个区域的作用：以下不讲定义，只是以上面代码为实例，加上作者本人的理解，如有偏差，请自行取舍。\n\n#### 局部变量表：\n故名思意就是存放局部变量的，以上代码中，在  **compute（）** 方法创建的栈帧的局部变量表中存放的是：a,b,c三个局部变量，在 **main()** 方法创建的栈帧的局部变量表中存放的是 math这个变量。\n#### 操作数栈：\n在作者的理解看来，操作数栈就是一个中转站。\n对照前面的字节码指令，我们可以很清晰的知道了每一步，虚拟机的底层干了哪些事。\n第一步，执行iconst命令\n将一个常量加载到操作数栈![在这里插入图片描述](https://img-blog.csdnimg.cn/20191019155802174.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80MjE0Njk5Ng==,size_16,color_FFFFFF,t_70)\n这时我们可以看到操作数栈中有2个常量 1 和 2；\n\n第二步：执行字节码指令istore，将整型类型值存入局部变量中，并将操作数栈的内存释放出来。\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20191019162230527.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80MjE0Njk5Ng==,size_16,color_FFFFFF,t_70)\n第三步：执行字节码指令： \n   \n\n  \n```java\n    4: iload_1\n    5: iload_2\n    6: iadd\n    7: bipush        10\n    9: imul\n    10: istore_3\n    11: iload_3\n    12: ireturn\n```\n\n:从局部变量中装载第一个int类型的值到操作数栈\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20191019170110428.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80MjE0Njk5Ng==,size_16,color_FFFFFF,t_70)\n以上图片难以准确的解释程序执行时JVM的执行流程，建议研究以上字节码文件，指令可查看字节码指令手册，其实研究JVM的工作流程，最好的方式就是研究字节码文件。\n\n\n\n#### 动态连接区域：\n笔者尚未彻底明白。。。欢迎朋友们给我留言，交流\n\n\n笔者理解的JVM图：\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20191019171506472.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80MjE0Njk5Ng==,size_16,color_FFFFFF,t_70)\n\n### 关于GC:\nGC算法请参考我的另一篇文章：\nhttps://blog.csdn.net/weixin_42146996/article/details/102571871\n\n\n还是先上图：\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20191019175121608.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80MjE0Njk5Ng==,size_16,color_FFFFFF,t_70)\n\n上图我觉得已经解释的很详细了，笔者很懒，不想再多解释了\n\n\n\n\n\n\n\n\n\n\n\n\n\n', '7', '何袁辉', '2019-12-03 10:06:38', '9', '68', '0', 'jvm', '1', '1', '1', 'http://localhost:8081/images/82ad18fca433c2a102319063a17cfc8f1575335182602.jpg', '1', '1', 'JVM', 'JVM的内存模型很多人都看过，周志明老师的《深入理解Java虚拟机》已经解释的很清楚了。但是只限于概念性的知识，关于底层的原理并没有做深入的阐述，我们通过一个实例代码来分析JVM内存模型之间的联系与各模块之间的底层原理，底层比较复杂.');
INSERT INTO `article` VALUES ('28', 'MVCC', '## 什么是*MVCC*\nMVCC即Multi-Version Concurrency Control，中文翻译过来叫多版本并发控制。\n\n## MVCC解决的问题\n\nMySQl默认的存储引擎是InnoDB,默认的事务隔离级别是REPEATABLE RED（可重复度），这种事务隔离级别要求2个事务之间不能影响，而且还能支持并发，悲观锁无法达到这个性能要求。所以该隔离级别采用的是乐观锁的形式实现的，乐观锁采用的具体实现方式是：**MVCCC**\n\n## MVCC具体实现\n\nInnoDB的MVCC是通过在每一行记录的后面保存2个隐藏的列来实现的。这2个列，一个保存了行的创建时间，一个保存了行的过期时间（删除时间）。这里储存的并不是世纪的时间值，而是系统版本号。每开始一个事务，系统版本号自动递增。事务开始时刻的版本号会作为当前事务的版本号（也可以理解为ID）\n\n\n## MVCC具体实现举例：\n\n创建一张Person表：\n\n```\ncreate table Person(\nid int primary key auto_increment,\nname varchar(20)\n);\n```\n\n\n假设系统的版本号从1开始\n\n\n\n### insert\n\nInnoDB为新插入的每一行保存当前系统版本号作为版本号。第一个事务ID为1:\n\n\n```\nstart transaction\ninsert into Person values(null,\"zs\");\ninsert into Person values(null,\"ls\");\ninsert into Person values(null,\"ww\");\ncommit\n```\n\n对应在数据中的表如下(后面两列是隐藏列,我们通过查询语句并看不到)\n\n\nid | name  |创建时间（事务ID）  |删除时间（事务ID）\n---|---|---|---\n1 |zs | 1| undefined\n2 | ls| 1| undefined\n3 | ww| 1| undefined\n\n\n\n\n### select\n\n1.  InnoDB只会查找版本早于当前事务版本的数据行（也就是行的系统版本号小于或等于当前事务的版本号），这样可以确保事务读取到的行，要么是事务开始前就已经存在的，要么是事务自生插入或修改过的。\n2.  行的删除版本要么未定义（还没有数据对他进行删除操作），要么大于当前事务版本号（这样可以确保当前事务读到的行，在该事务之前未被删除）。\n\n\n\n只有符合上述2个条件的记录，才能作为结果返回给查询\n\n\n### delete\nInnoDB会为删除的每一行保存当前系统的版本号（事务ID）作为标识。\n\n第二个事务：ID为2\n\n\n\n```\nstart transaction; \nselect * from Person; \nselect * from Person; \ncommit;\n```\n\n#### 假设1：\n假设在执行这个事务ID为2的过程中,刚执行到(1),这时,有另一个事务ID为3往这个表里插入了一条数据; 第三个事务ID为3;\n\n```\nstart transaction;\ninsert into Person values(NULL,\'tian\');\ncommit;\n```\n\n这时表中的数据如下:\n\n\n\nid | name  |创建时间（事务ID）  |删除时间（事务ID）\n---|---|---|---\n1 |zs | 1| undefined\n2 | ls| 1| undefined\n3 | ww| 1| undefined\n4 | tain| 3 | undefined\n\n\n然后接着执行事务2中的(2),由于id=4的数据的创建时间(事务ID为3),执行当前事务的ID为2,而InnoDB只会查找事务ID小于等于当前事务ID的数据行,所以id=4的数据行并不会在执行事务2中的(2)被检索出来,在事务2中的两条select 语句检索出来的数据如下:\n\nid | name  |创建时间（事务ID）  |删除时间（事务ID）\n---|---|---|---\n1 |zs | 1| undefined\n2 | ls| 1| undefined\n3 | ww| 1| undefined\n\n\n### 假设2\n假设在执行这个事务ID为2的过程中,刚执行到(1),假设事务执行完事务3后，接着又执行了事务4; \n第四个事务: ID为4\n\n\n```\nstart transaction; \ndelete from Person where id=1; \ncommit;\n```\n\n此时数据库中的表如下:\n\nid | name  |创建时间（事务ID）  |删除时间（事务ID）\n---|---|---|---\n1 |zs | 1| 4\n2 | ls| 1| undefined\n3 | ww| 1| undefined\n4 | tain| 3 | undefined\n\n\n\n接着执行事务ID为2的事务(2),根据SELECT 检索条件可以知道,它会检索创建时间(创建事务的ID)小于当前事务ID的行和删除时间(删除事务的ID)大于当前事务的行,而id=4的行上面已经说过,而id=1的行由于删除时间(删除事务的ID)大于当前事务的ID,所以事务2的(2)select * from yang也会把id=1的数据检索出来.所以,事务2中的两条select 语句检索出来的数据都如下:\n\n\nid | name  |创建时间（事务ID）  |删除时间（事务ID）\n---|---|---|---\n1 |zs | 1| 4\n2 | ls| 1| undefined\n3 | ww| 1| undefined\n\n\n### UPDATE\n\n\nInnoDB执行UPDATE，实际上是新插入了一行记录，并保存其创建时间为当前事务的ID，同时保存当前事务ID到要UPDATE的行的删除时间。 \n\n\n\n### 假设3：\n假设在执行完事务2的(1)后又执行,其它用户执行了事务3,4,这时，又有一个用户对这张表执行了UPDATE操作: \n第5个事务:ID为5\n\n\n```\nstart transaction; \nupdate Person set name=\'Long\' where id=2;\ncommit;\n```\n\n根据update的更新原则:会生成新的一行,并在原来要修改的列的删除时间列上添加本事务ID,得到表如下:\n\nid | name  |创建时间（事务ID）  |删除时间（事务ID）\n---|---|---|---\n1 |zs | 1| 4\n2 | ls| 1| 5\n3 | ww| 1| undefined\n4 | tain| 3 | undefined\n2 | Long| 5 | undefined\n\n继续执行事务2的(2),根据select 语句的检索条件,得到下表:\n\n\nid | name  |创建时间（事务ID）  |删除时间（事务ID）\n---|---|---|---\n1 |zs | 1| 4\n2 | ls| 1| 5\n3 | ww| 1| undefined\n\n\n还是和事务2中(1)select 得到相同的结果.\n\n\n参考文章：\n[https://www.cnblogs.com/pautcher/p/7723422.html](https://www.cnblogs.com/pautcher/p/7723422.html)\n                  [https://segmentfault.com/a/1190000009374567](https://segmentfault.com/a/1190000009374567)\n                  参考书籍：《高性能MySQL》\n\n\n', '8', '何袁辉', '2019-12-31 13:22:34', '0', '5', '0', 'MVCC', '1', '1', '1', 'http://localhost:8081/images/762f99f369ae786f970477feeb3b9d771575335182697.jpg', '1', '1', 'MySQL', 'MVCC即Multi-Version Concurrency Control，中文翻译过来叫多版本并发控制');
INSERT INTO `article` VALUES ('29', 'GC算法', ' # Java虚拟机\n\n## 对象已死吗：\n\n#### 引用计数方法\n给对象添加一个计数器，每当一个地方引用他时，计数器就加1，当引用失效时，计数器就减1，任何时候计数器为0的对象就是不会再被使用的。\n\n**引用计数方法带来的问题：**\n无法解决对象之间循环引用的问题：例如：\n\n\n```\nPerson a=new Peson();\nPeson b=new Person();\na.instance=b;\nb.instance=a;\n```\n\n以上情况，使用计数器的话，是不会回收的。\n\n\n#### 可达性分析算法\n以一系列称为的GC Roots的对象作为起始点，从这些节点开始向下搜索，搜索走过的路径称为引用链，当一个对象到一个GC Roots 没有任何引用链相连接，就是GC Roots 到这个对象不可达，则声明此对象是不可用的。如图：\n\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20191015175758103.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80MjE0Njk5Ng==,size_16,color_FFFFFF,t_70)\n\n**在Java中，可以作为GC对象的包括以下几种：**\n\n1. 虚拟机栈（栈帧中的本地变量表）中引用的对象\n2. 方法区中类静态属性引用的变量\n3. 本地方法区中常量引用的对象\n4. 本地方法栈中JNI（Native方法）引用的对象\n5. \n\n\n## 垃圾收集算法\n#### 标记——清除算法\n算法分为标记和清除2个阶段：首先标记出所有需要回收的对象（对象判定方法：可达性分析），在标记完成后统一回收所有被标记的对象。\n\n**算法的不足：** \n\n 1 .标记和清除2个过程效率都不高。\n \n 2 .标记清除后会产生大量的内存碎片，空间碎片太多可能导致以后需要分配较大对象时，无法找到足够的连续内存不得不提前出发一次垃圾收集动作。\n\n##### 算法解释如图：\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20191015175819193.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80MjE0Njk5Ng==,size_16,color_FFFFFF,t_70)\n\n\n\n\n\n#### 复制算法\n它将可用内存按容量划分成大小相等的2块，每一次只使用其中的一块，当这一块内存用完了，就将还存活的对象复制到另一块内存上去，然后再把已经使用过的内存空间一次清理掉。这种算法的最大代价就是将内存缩小为原来的一半。\n\n\n#### 算法解释如图：\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20191015175907224.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80MjE0Njk5Ng==,size_16,color_FFFFFF,t_70)\n\n\n\n#### 标记———整理算法：\n标记的过程仍然和“标记--清除”算法一样，然后让所有存活的对象都向一端移动，然后直接清理掉端边界以外的内存。\n##### 算法解释如图：\n\n![在这里插入图片描述](https://img-blog.csdnimg.cn/20191015175840653.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80MjE0Njk5Ng==,size_16,color_FFFFFF,t_70)\n\n\n#### 分代收集算法：\n当代商业虚拟机都采用“分代回收算法”，分代：根据对象存活周期的不同将内存划分为几块，一般是把堆中分为新生代和老年代。\n\n\n**新生代：** 每一次垃圾收集都发现有大量对象死去，只有少量存活，就选用复制算法。\n\n**老年代：** 老年代中对象存活率高，使用标记整理算法来回收\n\n', '7', '何袁辉', '2019-12-03 10:10:44', '14', '28', '0', 'GC', '1', '1', '1', 'http://localhost:8081/images/49962501843114c70121ad142e60a0561575335223560.jpg', '1', '1', 'JVM', '对于Java开发人员来讲，想要让自己的技术进一步的得到提升，那么jvm是必须精通的。在jvm中很重要的一个模块就是垃圾回收机制，以及几种垃圾回收器。');
INSERT INTO `article` VALUES ('32', '离骚', '\n##       离骚      \n先秦：屈原                                   \n\n\n帝高阳之苗裔兮，朕皇考曰伯庸。\n\n摄提贞于孟陬兮，惟庚寅吾以降。\n\n皇览揆余初度兮，肇锡余以嘉名：\n\n名余曰正则兮，字余曰灵均。\n\n纷吾既有此内美兮，又重之以修能。\n\n扈江离与辟芷兮，纫秋兰以为佩。\n\n汩余若将不及兮，恐年岁之不吾与。\n\n朝搴阰之木兰兮，夕揽洲之宿莽。\n\n日月忽其不淹兮，春与秋其代序。\n\n惟草木之零落兮，恐美人之迟暮。(惟 通：唯)\n\n不抚壮而弃秽兮，何不改乎此度？\n\n乘骐骥以驰骋兮，来吾道夫先路！\n\n昔三后之纯粹兮，固众芳之所在。\n\n杂申椒与菌桂兮，岂惟纫夫蕙茝！\n\n彼尧、舜之耿介兮，既遵道而得路。\n\n何桀纣之猖披兮，夫惟捷径以窘步。\n\n惟夫党人之偷乐兮，路幽昧以险隘。\n\n岂余身之殚殃兮，恐皇舆之败绩！\n\n忽奔走以先后兮，及前王之踵武。\n\n荃不查余之中情兮，反信谗而齌怒。\n\n余固知謇謇之为患兮，忍而不能舍也。\n\n指九天以为正兮，夫惟灵修之故也。\n\n曰黄昏以为期兮，羌中道而改路！\n\n初既与余成言兮，后悔遁而有他。\n\n余既不难夫离别兮，伤灵修之数化。\n\n余既滋兰之九畹兮，又树蕙之百亩。\n\n畦留夷与揭车兮，杂杜衡与芳芷。\n\n冀枝叶之峻茂兮，愿俟时乎吾将刈。\n\n虽萎绝其亦何伤兮，哀众芳之芜秽。\n\n众皆竞进以贪婪兮，凭不厌乎求索。\n\n羌内恕己以量人兮，各兴心而嫉妒。\n\n忽驰骛以追逐兮，非余心之所急。\n\n老冉冉其将至兮，恐修名之不立。\n\n朝饮木兰之坠露兮，夕餐秋菊之落英。\n\n苟余情其信姱以练要兮，长顑颔亦何伤。\n\n掔木根以结茝兮，贯薜荔之落蕊。\n\n矫菌桂以纫蕙兮，索胡绳之纚纚。\n\n謇吾法夫前修兮，非世俗之所服。\n\n虽不周于今之人兮，愿依彭咸之遗则。\n\n长太息以掩涕兮，哀民生之多艰。\n\n余虽好修姱以鞿羁兮，謇朝谇而夕替。\n\n既替余以蕙纕兮，又申之以揽茝。\n\n亦余心之所善兮，虽九死其犹未悔。\n\n怨灵修之浩荡兮，终不察夫民心。\n\n众女嫉余之蛾眉兮，谣诼谓余以善淫。\n\n固时俗之工巧兮，偭规矩而改错。\n\n背绳墨以追曲兮，竞周容以为度。\n\n忳郁邑余侘傺兮，吾独穷困乎此时也。\n\n宁溘死以流亡兮，余不忍为此态也。\n\n鸷鸟之不群兮，自前世而固然。\n\n何方圜之能周兮，夫孰异道而相安？\n\n屈心而抑志兮，忍尤而攘诟。\n\n伏清白以死直兮，固前圣之所厚。\n\n悔相道之不察兮，延伫乎吾将反。\n\n回朕车以复路兮，及行迷之未远。\n\n步余马于兰皋兮，驰椒丘且焉止息。\n\n进不入以离尤兮，退将复修吾初服。\n\n制芰荷以为衣兮，集芙蓉以为裳。\n\n不吾知其亦已兮，苟余情其信芳。\n\n高余冠之岌岌兮，长余佩之陆离。\n\n芳与泽其杂糅兮，唯昭质其犹未亏。\n\n忽反顾以游目兮，将往观乎四荒。\n\n佩缤纷其繁饰兮，芳菲菲其弥章。\n\n民生各有所乐兮，余独好修以为常。\n\n虽体解吾犹未变兮，岂余心之可惩。\n\n女嬃之婵媛兮，申申其詈予，曰：\n\n「鲧婞直以亡身兮，终然夭乎羽之野。\n\n汝何博謇而好修兮，纷独有此姱节？\n\n薋菉葹以盈室兮，判独离而不服。」\n\n众不可户说兮，孰云察余之中情？\n\n世并举而好朋兮，夫何茕独而不予听？\n\n依前圣以节中兮，喟凭心而历兹。\n\n济沅、湘以南征兮，就重华而敶词：\n\n启《九辩》与《九歌》兮，夏康娱以自纵。\n\n不顾难以图后兮，五子用失乎家衖。\n\n羿淫游以佚畋兮，又好射夫封狐。\n\n固乱流其鲜终兮，浞又贪夫厥家。\n\n浇身被服强圉兮，纵欲而不忍。\n\n日康娱而自忘兮，厥首用夫颠陨。\n\n夏桀之常违兮，乃遂焉而逢殃。\n\n后辛之菹醢兮，殷宗用而不长。\n\n汤、禹俨而祗敬兮，周论道而莫差。\n\n举贤才而授能兮，循绳墨而不颇。\n\n皇天无私阿兮，览民德焉错辅。\n\n夫维圣哲以茂行兮，苟得用此下土。\n\n瞻前而顾后兮，相观民之计极。\n\n夫孰非义而可用兮？孰非善而可服？\n\n阽余身而危死兮，览余初其犹未悔。\n\n不量凿而正枘兮，固前修以菹醢。\n\n曾歔欷余郁邑兮，哀朕时之不当。\n\n揽茹蕙以掩涕兮，沾余襟之浪浪。\n\n跪敷衽以陈辞兮，耿吾既得此中正。\n\n驷玉虬以桀鹥兮，溘埃风余上征。\n\n朝发轫于苍梧兮，夕余至乎县圃。\n\n欲少留此灵琐兮，日忽忽其将暮。\n\n吾令羲和弭节兮，望崦嵫而勿迫。\n\n路漫漫其修远兮，吾将上下而求索。\n\n饮余马于咸池兮，总余辔乎扶桑。\n\n折若木以拂日兮，聊逍遥以相羊。\n\n前望舒使先驱兮，后飞廉使奔属。\n\n鸾皇为余先戒兮，雷师告余以未具。\n\n吾令凤鸟飞腾兮，继之以日夜。\n\n飘风屯其相离兮，帅云霓而来御。\n\n纷总总其离合兮，斑陆离其上下。\n\n吾令帝阍开关兮，倚阊阖而望予。\n\n时暧暧其将罢兮，结幽兰而延伫。\n\n世溷浊而不分兮，好蔽美而嫉妒。\n\n朝吾将济于白水兮，登阆风而绁马。\n\n忽反顾以流涕兮，哀高丘之无女。\n\n溘吾游此春宫兮，折琼枝以继佩。\n\n及荣华之未落兮，相下女之可诒。\n\n吾令丰隆乘云兮，求宓妃之所在。\n\n解佩纕以结言兮，吾令謇修以为理。\n\n纷总总其离合兮，忽纬繣其难迁。\n\n夕归次于穷石兮，朝濯发乎洧盘。\n\n保厥美以骄傲兮，日康娱以淫游。\n\n虽信美而无礼兮，来违弃而改求。\n\n览相观于四极兮，周流乎天余乃下。\n\n望瑶台之偃蹇兮，见有娀之佚女。\n\n吾令鸩为媒兮，鸩告余以不好。\n\n雄鸠之鸣逝兮，余犹恶其佻巧。\n\n心犹豫而狐疑兮，欲自适而不可。\n\n凤皇既受诒兮，恐高辛之先我。\n\n欲远集而无所止兮，聊浮游以逍遥。\n\n及少康之未家兮，留有虞之二姚。\n\n理弱而媒拙兮，恐导言之不固。\n\n世溷浊而嫉贤兮，好蔽美而称恶。\n\n闺中既以邃远兮，哲王又不寤。\n\n怀朕情而不发兮，余焉能忍而与此终古？\n\n索琼茅以筳篿兮，命灵氛为余占之。\n\n曰：「两美其必合兮，孰信修而慕之？\n\n思九州之博大兮，岂惟是其有女？」\n\n曰：「勉远逝而无狐疑兮，孰求美而释女？\n\n何所独无芳草兮，尔何怀乎故宇？」\n\n世幽昧以昡曜兮，孰云察余之善恶？\n\n民好恶其不同兮，惟此党人其独异！\n\n户服艾以盈要兮，谓幽兰其不可佩。\n\n览察草木其犹未得兮，岂珵美之能当？\n\n苏粪壤以充祎兮，谓申椒其不芳。\n\n欲从灵氛之吉占兮，心犹豫而狐疑。\n\n巫咸将夕降兮，怀椒糈而要之。\n\n百神翳其备降兮，九疑缤其并迎。\n\n皇剡剡其扬灵兮，告余以吉故。\n\n曰：「勉升降以上下兮，求矩矱之所同。\n\n汤、禹俨而求合兮，挚、咎繇而能调。\n\n苟中情其好修兮，又何必用夫行媒？\n\n说操筑于傅岩兮，武丁用而不疑。\n\n吕望之鼓刀兮，遭周文而得举\n\n宁戚之讴歌兮，齐桓闻以该辅。\n\n及年岁之未晏兮，时亦犹其未央。\n\n恐鹈鴃之先鸣兮，使夫百草为之不芳。」\n\n何琼佩之偃蹇兮，众薆然而蔽之。\n\n惟此党人之不谅兮，恐嫉妒而折之。\n\n时缤纷其变易兮，又何可以淹留？\n\n兰芷变而不芳兮，荃蕙化而为茅。\n\n何昔日之芳草兮，今直为此萧艾也？\n\n岂其有他故兮，莫好修之害也！\n\n余以兰为可恃兮，羌无实而容长。\n\n委厥美以从俗兮，苟得列乎众芳。\n\n椒专佞以慢慆兮，樧又欲充夫佩帏。\n\n既干进而务入兮，又何芳之能祗？\n\n固时俗之流从兮，又孰能无变化？\n\n览椒兰其若兹兮，又况揭车与江离？\n\n惟兹佩之可贵兮，委厥美而历兹。\n\n芳菲菲而难亏兮，芬至今犹未沬。\n\n和调度以自娱兮，聊浮游而求女。\n\n及余饰之方壮兮，周流观乎上下。\n\n灵氛既告余以吉占兮，历吉日乎吾将行。\n\n折琼枝以为羞兮，精琼爢以为粻。\n\n为余驾飞龙兮，杂瑶象以为车。\n\n何离心之可同兮？吾将远逝以自疏。\n\n邅吾道夫昆仑兮，路修远以周流。\n\n扬云霓之晻蔼兮，鸣玉鸾之啾啾。\n\n朝发轫于天津兮，夕余至乎西极。\n\n凤皇翼其承旗兮，高翱翔之翼翼。\n\n忽吾行此流沙兮，遵赤水而容与。\n\n麾蛟龙使梁津兮，诏西皇使涉予。\n\n路修远以多艰兮，腾众车使径待。\n\n路不周以左转兮，指西海以为期。\n\n屯余车其千乘兮，齐玉轪而并驰。\n\n驾八龙之婉婉兮，载云旗之委蛇。\n\n抑志而弭节兮，神高驰之邈邈。\n\n奏《九歌》而舞《韶》兮，聊假日以媮乐。\n\n陟升皇之赫戏兮，忽临睨夫旧乡。\n\n仆夫悲余马怀兮，蜷局顾而不行。\n\n乱曰：已矣哉！\n\n国无人莫我知兮，又何怀乎故都！\n\n既莫足与为美政兮，吾将从彭咸之所居！', '35', '何袁辉', '2019-12-29 03:15:02', '0', '5', '0', '离骚；屈原', '1', '1', null, 'http://localhost:8081/images/veer-1469256151571059518054.jpg', '1', '1', '杂谈', '《离骚》是中国战国时期诗人屈原创作的诗篇，是中国古代最长的抒情诗。此诗以诗人自述身世、遭遇、心志为中心。前半篇反复倾诉诗人对楚国命运和人民生活的关心，表达要求革新政治的愿望，和坚持理想、虽逢灾厄也绝不与邪恶势力妥协的意志；后半篇通过神游天界、追求实现理想和失败后欲以身殉的陈述，反映出诗人热爱国家和人民的思想感情');
INSERT INTO `article` VALUES ('33', '提高摄影技术', '\n 面对“如何提高摄影技术”这个话题，不知多少大师你唱罢了我登场地来来回回地说过多次，无非就是光圈快门构图、或者是多练多看多思考等等，纵然是山珍海味吃多了也无味了。我更愿意试着从摄影之外的领域——读唐诗，去探讨一些观点，与大家分享，也欢迎交流探讨。\n\n\n寻求摄影技术之外——意境的突破\n\n唐诗之中，气象万千，有大气磅礴、有温婉婉转，很多的唐诗本身就是一幅画。我觉得，最为代表性的便是王维，“空山不见人，但闻人语响。返景入深林，复照青苔上”试看这四句，其实每一句都可以是一幅摄影作品，而且是非常有意境的摄影作品，摄影者按照此思路亦可以推出摄影环境与时机选择的一点启发， 空山的“空”字经点出了一丝空灵与幽静，这些都是摄影作品所讲求的精髓——意境。\n\n\n\n然后还有一个“闻”字，这是最难表现的。这里引出一个故事，宋代时设画院，出了一个题目：踏花归去马蹄香，要求学子以此为想象画一幅画，有人静心画了一匹骏马在花丛驰骋，虽有气势，却没有体现出“香”，可恰恰“香”字才是一句的点睛之笔。但“香”是去用嗅觉去“闻”的，如何用画笔去表达这是莫大的难题。在众多应试中有一个学子画了一幅：夕阳归去，一位少年奔腾着马蹄之下一群蝴蝶紧紧的跟随着。一下就用蝴蝶点出了一个“香”字，如何用摄影手法去表达，这是考验我辈的难题，但确实也很有趣，值得把玩研究。\n\n\n最后两句：”反景入深林，复照青苔上“倒是可以可以拍出一点那么意思，这里的”反景“是说”影“的意思， 就是斜阳照到深林之中，又射到青苔上面，都是很平淡的描写，但都是透出的安静的气息。\n\n\n王维的诗很多大都可以入画，再例如：渭城朝雨浥轻尘, 客舍青青柳色新。 劝君更尽一杯酒,西出阳关无故人。从美术的角度来说，“朝雨” “轻尘” “柳色”，这些都是美术与摄影的审美元素，天时，地利，加之摄影者的人和，亦可全部入画。“西出阳关无故人”更是一幅苍凉的图画。\n\n\n摄影的追求无止境，当你感觉在上升的通道上遇到了“瓶颈”，不妨放下相机、忘却光圈快门、摄影技术，从那些看似“无用”的领域，吸取于摄影有益的营养', '34', '何袁辉', '2019-12-29 04:18:33', '2', '11', '0', '摄影;生活', '1', '1', null, 'http://localhost:8081/images/75842f4d1e18d692a66c38eb172a40ab1575362156409.jpg', '1', '1', '生活', '如何提高摄影技术？提出这样问题的，往往不是摄影新手，因为新手首先关心的是摄影入门的基础知识，而不是”提高“技术。想到“如何提高摄影技术”这样一个问题的，通常是接触摄影一段时间后，突然感觉摄影水平停滞不前、无法突破，遇到了“瓶颈”，于是，自然而然就会思考：如何提高摄影技术？');
