  `categoryId` int(11) unsigned NOT NULL COMMENT '文章所属类别id',
  `author` varchar(255) DEFAULT NULL COMMENT '作者',
  `addTime` datetime DEFAULT NULL COMMENT '文章发布时间',
  `agreeNum` int(11) DEFAULT NULL COMMENT '文章点赞数量',
  `browseNum` int(11) NOT NULL COMMENT '文章浏览量',
  `commentNum` int(11) DEFAULT NULL COMMENT '文章评论数量',
  `keyWord` varchar(255) DEFAULT NULL COMMENT '文章关键字',
  `status` int(11) DEFAULT NULL COMMENT '文章状态   -1，垃圾箱   0，草稿箱 1，发布状态',
  `isRecommend` int(11) DEFAULT NULL COMMENT '是否为推荐文章 0否  1是',
  `isTop` int(11) DEFAULT NULL COMMENT '是否置顶   0 否  ，1是',
  `images` varchar(255) DEFAULT NULL COMMENT '文章图片地址',
  `isDiscuss` int(11) NOT NULL DEFAULT '1',
  `isYuanChuang` int(11) DEFAULT NULL,
  `categoryName` varchar(255) NOT NULL,
  `summary` varchar(1000) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '文章摘要',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8;

